import React, { useEffect } from "react";
import { Outlet } from "react-router-dom";
import NavBar from "./Components/NavBar/Navbar";
import { useAuth } from "./Components/auth/useAuth";

function App() {
  useEffect(() => {
    if (!authed) {
      navigate("/");
    }
  }, []);

  return (
    <div className="App">
      <NavBar />
      <Outlet />
    </div>
  );
}
export default App;
